what made you fall in love with him ?
I couldn't answer it right away,
but the same night, lying in bed I asked myself
why do you love him ?
What is special about him ?
and all i could remember was the time we spent together,
it was his little gestures of care and love that made me fall in love with him.

Here are some of them :-
1. The way he looked and smiled at me.
2. The way he put his arms around my shoulders while walking.
3. Every bite of food tasted better when he feeded it with his hands.
4. The way he teased me everytime by pulling my cheeks.
5. The way he called me with different names(all cute ones).
and many many more...
.
You see we don't fall in love with someone right from the start. We slowly fall
in love by spending more time with them, and observing their little gestures for us.
.
- Neha Joseph
